// src/components/CountryDetailPage.jsx
import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import logo from '../images/dept-logo.png';
import BackButton from './BackButton';

export default function CountryDetailPage({ token, logout }) {
  const { code } = useParams();
  const navigate = useNavigate();

  const [countryName, setCountryName] = useState('');
  const [capital, setCapital] = useState('');
  const [population, setPopulation] = useState(null);
  const [currency, setCurrency] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  // 1) Redirect if not logged in
  useEffect(() => {
    if (!token) navigate('/');
  }, [token, navigate]);

  // 2) Fetch country details
  useEffect(() => {
    (async () => {
      try {
        const res = await fetch(`https://restcountries.com/v3.1/alpha/${code}`);
        if (!res.ok) throw new Error(res.statusText);
        const js = await res.json();
        const info = js[0] || {};

        setCountryName(info.name?.common || code);
        setCapital(Array.isArray(info.capital) ? info.capital[0] : info.capital || '–');
        setPopulation(typeof info.population === 'number' ? info.population : null);
        const currs = info.currencies || {};
        const [key] = Object.keys(currs);
        setCurrency(key ? `${key} (${currs[key].name})` : '–');
      } catch (e) {
        console.error(e);
        setError('Error fetching country data.');
      } finally {
        setLoading(false);
      }
    })();
  }, [code]);

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center">
        <p>Loading country details…</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="min-h-screen flex flex-col items-center justify-center px-4">
        <p className="text-red-600 mb-4">{error}</p>
        <button onClick={() => window.location.reload()} className="btn">
          Retry
        </button>
      </div>
    );
  }

  // Main render
  return (
    <div className="relative min-h-screen bg-gray-100">
      {/* Fixed navbar */}
      <div className="fixed top-0 left-0 w-full bg-gray-100 z-20 flex items-center justify-between px-4 py-2 shadow-none">
        <div className="flex items-center space-x-2">
          <img src={logo} alt="Dept Logo" className="w-12 h-auto" />
          <BackButton to="/solution" />
        </div>
        {token && (
          <button onClick={logout} className="btn">
            Log out
          </button>
        )}
      </div>

      {/* Spacer */}
      <div className="pt-16" />

      {/* Square map */}
      <div className="mt-6 flex justify-center px-4">
        <div className="w-full max-w-3xl aspect-square rounded overflow-hidden shadow">
          <iframe
            title={`map-${code}`}
            src={`https://maps.google.com/maps?q=${encodeURIComponent(
              countryName
            )}&output=embed`}
            className="w-full h-full object-cover"
            allowFullScreen
          />
        </div>
      </div>

      {/* Details below map */}
      <h1 className="text-6xl font-bold text-gray-800 text-center mt-8">
        {countryName}
      </h1>
      <div className="mt-4 max-w-md mx-auto text-center space-y-2 text-gray-700">
        <p><strong>Glavni grad:</strong> {capital}</p>
        <p>
          <strong>Populacija:</strong>{' '}
          {population !== null ? population.toLocaleString('hr-HR') : '–'}
        </p>
        <p><strong>Valuta:</strong> {currency}</p>
      </div>
    </div>
  );
}
